#define _pixel_RGBA_to_P8R8G8B8(r, g, b, a) ( \
        (((a)) << 24) | \
        ((((r) * _pixel_norm(a)) >> 8) << 16) | \
        ((((g) * _pixel_norm(a)) >> 8) <<  8) | \
        ((((b) * _pixel_norm(a)) >> 8) <<  0))

#define _pixel_from_P8R8G8B8(c, r, g, b, a) do { \
            IUINT32 __SA = ((c) >> 24); \
            IUINT32 __FA = (__SA); \
            (a) = __SA; \
            if (__FA > 0) { \
                (r) = ((((c) >> 16) & 0xff) * 255) / __FA; \
                (g) = ((((c) >>  8) & 0xff) * 255) / __FA; \
                (b) = ((((c) >>  0) & 0xff) * 255) / __FA; \
            }    else { \
                (r) = 0; (g) = 0; (b) = 0; \
            }    \
        }   while (0)

