void ResampleX1R5G5B5(unsigned short *dst, int dx, int dy, unsigned short *src, int sx, int sy)
{
	BasicBitmap bdst(dx, dy, BasicBitmap::X1R5G5B5, dst, dx * 2);
	BasicBitmap bsrc(sx, sy, BasicBitmap::X1R5G5B5, src, sx * 2);

	bdst.Resample(0, 0, dx, dy, &bsrc, 0, 0, sx, sy, BasicBitmap::ResampleFilter::BILINEAR);
}

